import React from "react";
import {BsBook} from 'react-icons/bs'
import Logo from '../Assests/Images/Knownjobz logo.jpeg'

const Navbar = () => {
  return (
    <React.Fragment>
      <section>
        <div className='bg-light h-20 w-full flex items-center pl-10 space-x-4'>
            <div>
            <BsBook className='text-white text-4xl'/>
            </div>

            <div className="Logo-container">
              <img src={Logo}/>
            </div>
        </div>
      </section>
    </React.Fragment>
  );
};

export default Navbar;
